// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "./Deccert.sol";

contract Server is Ownable,ReentrancyGuard{

    mapping(address=>mapping(string=>bool)) debt;

    Deccert BASE_CONTRACT;

    uint256 public PRICE=0.01 ether;
    address ADMIN;

    constructor(Deccert smart_contract){
        BASE_CONTRACT=smart_contract;
        ADMIN=msg.sender;
    }

    modifier onlyAdmin(){
        require(msg.sender==ADMIN,'only admin');
        _;
    }

    //Funcion para que el dueño cambie el precio
    function setMinPrice(uint256 _minPrice)public onlyOwner{
        PRICE=_minPrice;
    }

    function setAdmin(address _admin)external onlyOwner{
        ADMIN=_admin;
    }

    function checkPayment(address _user,string memory _uri)public view returns(bool){
        return debt[_user][_uri];
    }

    function currentPrice()external view returns(uint256){
        return PRICE;
    }

    function pay(string memory _uri)external payable{
        require(!debt[msg.sender][_uri],'Already paid');
        require(msg.value>=PRICE,'not the price');

        debt[msg.sender][_uri]=true;
    }       

    function mint(
        string memory _name,
        string memory _uri,
        address _who)external onlyAdmin{
        require(debt[_who][_uri],'user no pay');

        BASE_CONTRACT.PermissionMinting(_name, _uri, _who);
        debt[_who][_uri]=false;
    }

    function withdraw(address _receiver)public onlyOwner{
        uint256 totalAmount=address(this).balance;
        (bool sent, ) = _receiver.call{value:totalAmount}("");
        require(sent,"No good withdraw");
    }

}

//el dueño de Deccert Smart contract tiene que darle mint power al SC Server
